import styled from 'styled-components';

export const SignUpWrapper = styled.div`
  width: 380px;
  margin: 30px auto;
  padding: 0 30px;
  position: relative;

  button {
    font-size: 10px;
  }


  button {
    position: absolute;
    left: 27.5%;
    margin: 0;
  }
`

export const SignUpTitle = styled.h2`
  margin: 10px 0;
  text-align: center;
`
